import React from 'react'
import  { useState, useEffect } from 'react'
import { useNavigate } from 'react-router-dom'
import { Form, Button,Container, Row, Col } from 'react-bootstrap'
import { useDispatch, useSelector } from 'react-redux'
import { saveShippingAddress } from '../actions/Cartactions'
import { Loader } from '@googlemaps/js-api-loader';
function Shippingscreen() {
  const cart = useSelector(state => state.cart)
  const { shippingAddress } = cart
  const navigate=useNavigate()
  const dispatch = useDispatch()

  const [address, setAddress] = useState(shippingAddress.address)
  const [addresscity, setAddresscity] = useState(shippingAddress.addresscity)
  const [city, setCity] = useState(shippingAddress.city)
  const [state, setState] = useState(shippingAddress.state)
  const [country, setCountry] = useState(shippingAddress.country)
  const [postalCode, setPostalCode] = useState(shippingAddress.postalCode)

  const submitHandler = (e) => {
      e.preventDefault()
      dispatch(saveShippingAddress({ address, city, postalCode, country }))
      navigate('/payment')
  }
  function faddresscity(e)
  {
    let changed=e
    const google =  GoogleMapsApiClient;
    let autocomplete = new google.maps.places.Autocomplete((changed), {types: ['(cities)'],componentRestrictions: {country: "IN"}});
    google.maps.event.addListener(autocomplete, 'place_changed', function () {var near_place = autocomplete.getPlace();});




  }

  return (

      <Container>
            <Row className="justify-content-md-center">
                <Col xs={12} md={6}>
          
          <h1 style={{paddingTop:"30%",color:"orange",userSelect:"none"}}>Delivery Address</h1>
          <Form onSubmit={submitHandler}>

              <Form.Group controlId='address' className='pt-3'>
                  <Form.Label style={{userSelect:"none"}}>Address</Form.Label>
                  <Form.Control
                      required
                      type='text'
                      placeholder='Enter address'
                      value={address ? address : ''}
                      onChange={(e) => setAddress(e.target.value)}
                  >
                  </Form.Control>
              </Form.Group>
              
              <Form.Group controlId='addresscity' className='pt-3'>
                  <Form.Label style={{userSelect:"none"}}>Address</Form.Label>
                  <Form.Control
                      required
                      type='text'
                      placeholder='Enter addresscity'
                      value={addresscity ? addresscity : ''}
                      onChange={(e) =>faddresscity(e.target.value)}
                  >
                  </Form.Control>
              </Form.Group>

              <Form.Group controlId='city' className='pt-3'>
                  <Form.Label style={{userSelect:"none"}}>City</Form.Label>
                  <Form.Control
                      required
                      type='text'
                      placeholder='Enter city'
                      value={city ? city : ''}
                      onChange={(e) => setCity(e.target.value)}
                  >
                  </Form.Control>
              </Form.Group>
              <Form.Group controlId='state' className='pt-3'>
                  <Form.Label style={{userSelect:"none"}}>State</Form.Label>
                  <Form.Control
                      required
                      type='text'
                      placeholder='Enter state'
                      value={state ? state : ''}
                      onChange={(e) => setCountry(e.target.value)}
              ></Form.Control>
                </Form.Group>
              <Form.Group controlId='country' className='pt-3'>
                  <Form.Label style={{userSelect:"none"}}>Country</Form.Label>
                  <Form.Control
                      required
                      type='text'
                      placeholder='Enter country'
                      value={country ? country : ''}
                      onChange={(e) => setCountry(e.target.value)}
                  >
                  </Form.Control>
              </Form.Group>
              <Form.Group controlId='postalCode' className='pt-3 pb-3'>
                  <Form.Label style={{userSelect:"none"}}>Postal Code</Form.Label>
                  <Form.Control
                      required
                      type='text'
                      placeholder='Enter postal code'
                      value={postalCode ? postalCode : ''}
                      onChange={(e) => setPostalCode(e.target.value)}
                  >
                  </Form.Control>
              </Form.Group>

              <Button type='submit' variant='primary' className='btn btn-warning'>
                  Continue
              </Button>
          </Form>
          </Col>
            </Row>
        </Container>
  )
}

export default Shippingscreen
